import {useEffect, useState} from "react";
import {apiRoutes} from "../routes/apiRoutes";
import axios from "axios";
import CardMedia from "@mui/material/CardMedia";
import Paper from "@mui/material/Paper";
import {styled, createTheme, responsiveFontSizes, ThemeProvider } from "@mui/material/styles";
import { height } from "@mui/system";

const ImageItem = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#fff' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'left',
    minHeight:'130px',
    color: theme.palette.text.secondary,
    display:'flex',
    justifyContent:'center',
    alignContent:'center',
    direction:'row'
}));

const AsyncImage = (props) => {
    let {height = 194} = props;
  
    const [loadedSrc, setLoadedSrc] = useState(false);
    const [imageSrc, setImageSrc] = useState(null);
    

    useEffect(() => {
        setLoadedSrc(false);
        if (props.src) {
            axios.get(`${apiRoutes.productcatalog}/api/Pcmt/GetImage?imageURL=${props.src}`, {
                responseType: 'arraybuffer',
                headers: {
                    Accept: 'image/jpeg',
                },
            }).then(response =>{
                const imageData = response.data;
                const imageReturned = URL.createObjectURL(new Blob([imageData], { type: 'image/jpeg' }));
                setImageSrc(imageReturned)
                setLoadedSrc(true);
            })
        }
    }, [props.src]);

    return (
        <>
            {loadedSrc &&
                <CardMedia
                    sx={{ objectFit: "fill" }}
                    component="img"
                    image={imageSrc}
                    alt=""
                    height={height}
                />
            }
            {!loadedSrc &&
                <img
                    height={height}
                    src="data:image/png;base64,"
                    alt="Paella dish"
                />
            }

        </>
    );
};

export default AsyncImage;